import React, { useEffect } from 'react';
import AOS from 'aos';
import 'aos/dist/aos.css';

const About = () => {
  useEffect(() => {
    AOS.init({
      duration: 1000,
      once: false,
    });
  }, []);

  return (
    <div className="about-page">
      <section className="about-section">
        <div className="container">
          {/* Yahan lagao animation */}
          <h1 data-aos="fade-down">About Me</h1>
          
          <div className="about-content">
            {/* Yahan bhi lagao */}
            <div className="about-text" data-aos="fade-right" data-aos-delay="200">
              <p>
                Hello! I'm a passionate storyteller and developer who loves
                creating meaningful digital experiences. With expertise in
                the MERN stack, I bring ideas to life through clean code
                and beautiful design.
              </p>
              
              {/* Dusra paragraph */}
              <p data-aos="fade-left" data-aos-delay="400">
                My journey in web development started with a curiosity about
                how things work behind the scenes. Today, I specialize in
                building full-stack applications that solve real-world problems.
              </p>
              
              {/* Skills section */}
              <div className="skills" data-aos="zoom-in" data-aos-delay="600">
                <h3>Technical Skills</h3>
                <div className="skill-tags">
                  <span className="skill-tag" data-aos="flip-up" data-aos-delay="700">MongoDB</span>
                  <span className="skill-tag" data-aos="flip-up" data-aos-delay="800">Express.js</span>
                  <span className="skill-tag" data-aos="flip-up" data-aos-delay="900">React.js</span>
                  <span className="skill-tag" data-aos="flip-up" data-aos-delay="1000">Node.js</span>
                  <span className="skill-tag" data-aos="flip-up" data-aos-delay="1100">JavaScript</span>
                  <span className="skill-tag" data-aos="flip-up" data-aos-delay="1200">HTML/CSS</span>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default About;
